import React from "react";
import { Dimensions } from "react-native";
import { createDrawerNavigator } from "@react-navigation/drawer";

import {
  HomePage,
  UpcomingShows,
  Clips,
  Store,
  WaitList,
  PlayVideoScreen,
  RentSeries,
  GladiatorsLanding,
  Episodes,
  CreditCard,
} from "../screens";
import { NavBar } from "../components/";
import HomeStack from "./homeStack";
import AuthStack from "./AuthStack";

const WIDTH = Dimensions.get("window").width;

const navigationOptions = () => {
  return {
    headerTitle: () => <NavBar />,
  };
};

const Drawer = createDrawerNavigator();

const DrawerNav = () => {
  return (
    <Drawer.Navigator
      initialRouteName="Home"
      screenOptions={{
        // headerShown: false,
        swipeEdgeWidth: 50,
        drawerStyle: {
          width: WIDTH * 0.6,
        },
      }}
      // useLegacyImplementation={true}
    >
      {/* {!auth && <HomeStack />} */}
      <Drawer.Screen
        name="HomePage"
        component={HomeStack}
        onPress={() =>
          navigation.dispatch(
            CommonActions.reset({
              index: 0,
              routes: [{ name: "HomePage" }],
            })
          )
        }
        options={{
          // navigationOptions: navigationOptions,
          title: "HOME",
        }}
      />
      {/* <Drawer.Screen name="SignIn" component={AuthStack} /> */}
      {/* <Drawer.Screen
        name="SignUp"
        component={AuthStack}
        options={{
          navigationOptions: navigationOptions,
          title: "SIGN UP",
        }}
      /> */}

      <Drawer.Screen
        name="GladiatorsLanding"
        component={GladiatorsLanding}
        options={{
          // navigationOptions: navigationOptions,
          title: "GLADIATORS OF STEEL",
        }}
      />
      <Drawer.Screen
        name="Clips"
        component={Clips}
        options={{
          navigationOptions: navigationOptions,
          title: "CLIPS",
        }}
      />

      <Drawer.Screen
        name="Episodes"
        component={Episodes}
        options={{
          navigationOptions: navigationOptions,
          title: "Episodes",
        }}
      />
      <Drawer.Screen
        name="UpcomingShows"
        component={UpcomingShows}
        options={{
          navigationOptions: navigationOptions,
          title: "Upcoming Shows",
        }}
      />
      <Drawer.Screen
        name="Store"
        component={Store}
        options={{
          navigationOptions: navigationOptions,
          title: "STORE",
        }}
      />
      <Drawer.Screen
        name="WaitList"
        component={WaitList}
        options={{
          navigationOptions: navigationOptions,
          title: "Waitlist",
        }}
      />
      <Drawer.Screen
        name="Rental"
        component={RentSeries}
        options={{
          navigationOptions: navigationOptions,
          title: "Rental",
        }}
      />
    </Drawer.Navigator>
  );
};

